window.bookSummaryJSON = "<p>Great Uncle Winter has a dark secret - milk and cookies. He doesn't just like them, he needs them to maintain his essential goodness. When an abominable snow rat infestation devours his entire stash in the North Pole he starts to turn evil, and Justine's guild must reunite a lost tribe of elves that abandoned the North Pole centuries ago to bring the big man in red the greatest cookies in all the land.</p> <p>Problem is, the lost tribe doesn't want to be found, and monsters turn up around every corner. They'll battle frost wyrms, frozen rat fiends, and other terrors of the cold in the name of protecting Winter Festival cheer.</p> <p>Now that the quest to unlock the elusive logout button has been revealed, Justine needs to assemble a team of adventurers to travel to the North Pole before the winter celebration. What they find there could change the holidays in Freehaven Online forever. An end to their imprisonment in virtual reality is at stake, and the only way their holiday wishes of returning to the real world will come true is if they can save a virtual Santa.</p>"; 
